import React from "react";
import NameIntro from "./components/nameintro";
import LatestArticle from "./components/latestarticle";

function App() {
  return (
    <div
      style={{
        display: "grid",
        gridTemplateColumns: "repeat(auto-fill, minmax(120ch, 1fr))",
        gridAutoFlow: "row dense",
      }}
    >
      <div>
        <NameIntro />
      </div>
      <div>
        <LatestArticle />
      </div>
    </div>
  );
}

export default App;
